INSERT INTO `aggregator_item` VALUES (1,1,'The Future Of Marketing Automation','http://techcrunch.com/2015/04/23/the-future-of-marketing-automation/?ncid=rss','Vik Singh','<img width=\"680\" height=\"483\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/marketingfuture.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"marketingfuture\" />&nbsp;According to industry expert David Raab, almost 70 percent of marketers are either unhappy or only marginally happy with their marketing automation software, and according to Bluewolf&#8217;s new &#8220;State of Salesforce&#8221; study, only 7 percent are seeing good, measurable ROI from those investments. There&#8217;s a lot of fragmentation and dissatisfaction in this category despite the&hellip; <a href=\"http://techcrunch.com/2015/04/23/the-future-of-marketing-automation/?ncid=rss\">Read More</a>',1429822801,'http://techcrunch.com/?p=1145709'),(2,1,'Airbnb Hires Former Dropbox Exec Sara Adler As Its Head Of Corporate Development','http://techcrunch.com/2015/04/23/airbnb-sara-adler/?ncid=rss','Ryan Lawler','<img width=\"680\" height=\"453\" src=\"https://tctechcrunch2011.files.wordpress.com/2014/09/airbnb-a8707ed9_original.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"airbnb-a8707ed9_original\" />&nbsp;There&#8217;s a battle going on for tech talent in the Bay Area, and private companies increasingly are turning to M&#38;A as a way to bring new members onto their teams. Following along on that trend, Airbnb has hired Sara Adler, who had previously worked at Dropbox and Facebook, as its head of corporate development.\nAdler will step into the newly created role to create some structure in&#8230; <a href=\"http://techcrunch.com/2015/04/23/airbnb-sara-adler/?ncid=rss\">Read More</a>',1429822806,'http://techcrunch.com/?p=1148506'),(3,1,'Amazon’s Q1 Beats As Revenue Rises 15% To $22.72 Billion, EPS Loss Of $0.12','http://techcrunch.com/2015/04/23/amazons-q1-beats-as-revenue-rises-15-to-22-72-billion-eps-loss-of-0-12/?ncid=rss','Sarah Buhr','<img width=\"680\" height=\"382\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/amazon-earnings-alt.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"amazon-earnings-alt\" />&nbsp;Today following the bell, Amazon reported its first quarter 2015 financial performance, including revenue of $22.72 billion and negative earnings per share of $0.12. The street expected Amazon to lose $0.13 per share, on revenue of $22.39 billion. Amazon also announced that its cloud computing business, AWS, had revenue of $1.5 billion in the quarter, with a run rate of $5 billion a year&hellip; <a href=\"http://techcrunch.com/2015/04/23/amazons-q1-beats-as-revenue-rises-15-to-22-72-billion-eps-loss-of-0-12/?ncid=rss\">Read More</a>',1429823348,'http://techcrunch.com/?p=1148298'),(4,1,'Lyft CEO Logan Green To Join Us At Disrupt NY','http://techcrunch.com/2015/04/23/lyft-ceo-logan-green-to-join-us-at-disrupt-ny/?ncid=rss','Ryan Lawler','<img width=\"645\" height=\"440\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/logan.png?w=645\" class=\"attachment-large wp-post-image\" alt=\"logan\" />&nbsp;The last time Lyft CEO Logan Green graced the Disrupt stage, in September 2013, the mobile ride-hailing service was a little more than a year old. Back then Lyft was available in just 10 markets, but was growing quickly thanks to an aggressive expansion roadmap that would take it into 25 U.S. cities by the end of that year. A lot has changed in the last 18 months, as Lyft has evolved from&hellip; <a href=\"http://techcrunch.com/2015/04/23/lyft-ceo-logan-green-to-join-us-at-disrupt-ny/?ncid=rss\">Read More</a>',1429825202,'http://techcrunch.com/?p=1148650'),(5,1,'The UDOO Neo Adds More Power To The Ultimate DIY Board','http://techcrunch.com/2015/04/23/the-udoo-neo-adds-more-power-to-the-ultimate-diy-board/?ncid=rss','John Biggs','<img width=\"680\" height=\"408\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/screen-shot-2015-04-23-at-5-52-32-pm.png?w=680\" class=\"attachment-large wp-post-image\" alt=\"Screen Shot 2015-04-23 at 5.52.32 PM\" />&nbsp;The original UDOO board was pretty amazing. A merging of Raspberry Pi and Arduino, the system let you run a tiny computer on a single board as well as control electronic projects. It was a very geeky little tool and proved to be quite popular. Well, the UDOO is back and it&#8217;s a lot better. The new UDOO Neo includes a Raspberry Pi, an Arduino board, a 9-axis sensor, magnetometer,&hellip; <a href=\"http://techcrunch.com/2015/04/23/the-udoo-neo-adds-more-power-to-the-ultimate-diy-board/?ncid=rss\">Read More</a>',1429826208,'http://techcrunch.com/?p=1148797'),(6,1,'IVP Raises $1.4B For Its 15th Fund','http://techcrunch.com/2015/04/23/another-damn-billion-dollar-vc-fund/?ncid=rss','Alex Wilhelm','<img width=\"680\" height=\"408\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/screen-shot-2015-04-14-at-11-51-37-pm1.png?w=680\" class=\"attachment-large wp-post-image\" alt=\"screen-shot-2015-04-14-at-11-51-37-pm\" />&nbsp;Institutional Venture Partners, better known as IVP, has raised a $1.4 billion 15th fund. The company&#8217;s last fund, it&#8217;s 14th, was a smaller $1 billion capital pool. I spoke to the firm&#8217;s Steve Harrick, a general partner, about the fund size, cadence, and investment strategy. According to Harrick, the fund was raised in a two month period. That matches other notes&hellip; <a href=\"http://techcrunch.com/2015/04/23/another-damn-billion-dollar-vc-fund/?ncid=rss\">Read More</a>',1429826420,'http://techcrunch.com/?p=1148790'),(7,1,'ClassPass Acquires Competitor FitMob','http://techcrunch.com/2015/04/23/classpass-acquires-competitor-fitmob/?ncid=rss','Jordan Crook,Sarah Buhr','<img width=\"680\" height=\"383\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/01/classpass.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"classpass\" />&nbsp;If you were curious about potential consolidation in the fitness space (which I&#8217;m sure you were), look no further than this very article. ClassPass, the subscription service for unlimited monthly fitness classes, has acquired direct competitor FitMob for an undisclosed amount. ClassPass, a company that has raised more than $54 million in the past three years, is a subscription service&hellip; <a href=\"http://techcrunch.com/2015/04/23/classpass-acquires-competitor-fitmob/?ncid=rss\">Read More</a>',1429827944,'http://techcrunch.com/?p=1148623'),(8,1,'Previously Bootstrapped, GoFundMe Is Raising At A Valuation Of Around $500M','http://techcrunch.com/2015/04/23/previously-bootstrapped-gofundme-is-raising-at-a-valuation-of-around-500m/?ncid=rss','Matthew Lynley','<img width=\"680\" height=\"504\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/screen-shot-2015-04-21-at-4-15-47-pm.png?w=680\" class=\"attachment-large wp-post-image\" alt=\"Screen Shot 2015-04-21 at 4.15.47 PM\" />&nbsp;TechCrunch is hearing from a few sources that GoFundMe, a crowdfunding and fundraising startup, is seeking venture financing after bootstrapping the company since 2008.\nAccording to those sources, Accel Partners is in the mix, and one says they may be leading the round. Sources said the valuation is around $500 million, though one source said the valuation could that go&#8230; <a href=\"http://techcrunch.com/2015/04/23/previously-bootstrapped-gofundme-is-raising-at-a-valuation-of-around-500m/?ncid=rss\">Read More</a>',1429828722,'http://techcrunch.com/?p=1147701'),(9,1,'Unraveling Comcast Merger Exposes Weaknesses In Its Powerful Lobbying Arm','http://techcrunch.com/2015/04/23/unraveling-comcast-merger-exposes-weaknesses-in-its-powerful-lobbying-arm/?ncid=rss','Cat Zakrzewski','<img width=\"680\" height=\"368\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/comcast.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"Comcast\" />&nbsp;Comcast spent $4.62 million on lobbying in the first quarter of 2015, an increase of 50 percent from its spending in the same quarter last year. But now the cable giant is reportedly walking away with little to show.\nMuch of Comcast&#8217;s spending was aimed at ushering through the company&#8217;s merger with Time Warner Cable Inc. and preventing the adoption of strict net neutrality rules. <a href=\"http://techcrunch.com/2015/04/23/unraveling-comcast-merger-exposes-weaknesses-in-its-powerful-lobbying-arm/?ncid=rss\">Read More</a>',1429831396,'http://techcrunch.com/?p=1148643'),(10,1,'Say Hello To The Apple Watch','http://techcrunch.com/2015/04/23/say-hello-to-the-apple-watch-2/?ncid=rss','Darrell Etherington','<img width=\"680\" height=\"383\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/applewatch-large.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"applewatch-large\" />&nbsp;The Apple Watch has landed, so to speak, with deliveries officially arriving to the first pre-order customers around the world. Apple&#8217;s first wearable device has enjoyed one of the longest pre-launch promotional cycles of any of its products, and with good reason &#8211; it&#8217;s a very different gadget from anything Apple has created before. We&#8217;ve had a few days to try out&hellip; <a href=\"http://techcrunch.com/2015/04/23/say-hello-to-the-apple-watch-2/?ncid=rss\">Read More</a>',1429848066,'http://techcrunch.com/?p=1148881'),(11,1,'India’s UrbanClap Matches Customers With The Best Local Service Providers','http://techcrunch.com/2015/04/23/urbanclap/?ncid=rss','Catherine Shu','<img width=\"680\" height=\"453\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/shutterstock_139803640.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"services\" />&nbsp;Based in Delhi, UrbanClap wants to make finding good service providers as easy as, well, clapping your hands. With more than 1,000 service providers currently listed, including individuals and companies, UrbanClap claims to be the largest mobile-based services marketplace in India. The startup, however, aspires to be more than just a listings platform. <a href=\"http://techcrunch.com/2015/04/23/urbanclap/?ncid=rss\">Read More</a>',1429858182,'http://techcrunch.com/?p=1148900'),(12,1,'With Lydia, Pay For Your Online Purchases Using Your Apple Watch','http://techcrunch.com/2015/04/24/with-lydia-pay-for-your-online-purchases-using-your-apple-watch/?ncid=rss','Romain Dillet','<img width=\"680\" height=\"432\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/lydia-watch-en-02.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"lydia-watch-en-02\" />&nbsp;Step by step, Lydia is unveiling its product strategy to handle all your payments. When I last covered the French startup, it was still mostly focused on growing its user base by providing a Venmo alternative for French users. But now, Lydia also lets you pay on e-commerce websites using Lydia, starting with PriceMinister. The app is now also available on the Apple Watch so that you can just&hellip; <a href=\"http://techcrunch.com/2015/04/24/with-lydia-pay-for-your-online-purchases-using-your-apple-watch/?ncid=rss\">Read More</a>',1429858914,'http://techcrunch.com/?p=1148563'),(13,1,'WhatsApp Calling On iOS Is Convenient But The Quality Won’t Blow You Away','http://techcrunch.com/2015/04/24/whatsapp-calling-on-ios-hands-on/?ncid=rss','Jon Russell','<img width=\"680\" height=\"510\" src=\"https://tctechcrunch2011.files.wordpress.com/2014/12/facebook-whatsapp-screen.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"facebook-whatsapp-screen\" />&nbsp;WhatsApp&#8217;s new voice calling feature for iOS is decent quality and easy to use, but the experience doesn&#8217;t beat dedicated VoIP apps for clarity. At this point, at least. <a href=\"http://techcrunch.com/2015/04/24/whatsapp-calling-on-ios-hands-on/?ncid=rss\">Read More</a>',1429860287,'http://techcrunch.com/?p=1148896'),(14,1,'iFixit Apple Watch Teardown Suggests No Internal Chip Upgrades','http://techcrunch.com/2015/04/24/ifixit-apple-watch-teardown/?ncid=rss','Natasha Lomas','<img width=\"592\" height=\"443\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/screen-shot-2015-04-24-at-9-41-47-am.png?w=592\" class=\"attachment-large wp-post-image\" alt=\"iFixit Apple Watch teardown\" />&nbsp;Today is Apple Watch D-Day for a speedy few early adopters, with Cupertino finally shipping the first batch of its debut wearable to buyers.  That means it&#8217;s also the day that serial repairers/tenacious teardowners iFixit get to crack open Apple&#8217;s latest sealed box and peer inside so we don&#8217;t have to. <a href=\"http://techcrunch.com/2015/04/24/ifixit-apple-watch-teardown/?ncid=rss\">Read More</a>',1429866728,'http://techcrunch.com/?p=1148917'),(15,1,'Jobscan Helps You Write Better Resumes','http://techcrunch.com/2015/04/24/jobscan/?ncid=rss','Catherine Shu','<img width=\"680\" height=\"453\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/shutterstock_58343785.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"resume\" />&nbsp;If you apply for a position at a large company, there is a chance that a human won&#8217;t even look at your resume. Many human resources department now use application tracking software (ATS) to help them sift through hundreds of applications. <a href=\"http://techcrunch.com/2015/04/24/jobscan/?ncid=rss\">Read More</a>',1429868312,'http://techcrunch.com/?p=1148939'),(16,1,'Infosys To Acquire E-Commerce Services Provider Kallidus For $120M','http://techcrunch.com/2015/04/24/infosys-kallidus-skala-120-million/?ncid=rss','Jon Russell','<img width=\"680\" height=\"453\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/infosys.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"infosys\" />&nbsp;Infosys, the India-headquartered consulting and IT firm, is on the verge of making its second significant acquisition of the year after it announced a deal to buy digital e-commerce services provider Kallidus for $120 million. It also made a $2 million investment in an air monitoring startup. <a href=\"http://techcrunch.com/2015/04/24/infosys-kallidus-skala-120-million/?ncid=rss\">Read More</a>',1429870451,'http://techcrunch.com/?p=1148938'),(17,1,'France To Head Open Government Partnership Only One Year After Joining It','http://techcrunch.com/2015/04/24/france-to-head-open-government-partnership-only-one-year-after-joining-it/?ncid=rss','Romain Dillet','<img width=\"680\" height=\"510\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/fullsizerender.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"FullSizeRender\" />&nbsp;Over the past two years, France has been a leading country when it comes to open data and open government &#8212; and it is paying off. Only one year after joining the Open Government Partnership, France has just been elected to head the Partnership starting in October 2016. I&#8217;ve been regularly covering France&#8217;s effort in this area as I think it&#8217;s an interesting take on&hellip; <a href=\"http://techcrunch.com/2015/04/24/france-to-head-open-government-partnership-only-one-year-after-joining-it/?ncid=rss\">Read More</a>',1429875591,'http://techcrunch.com/?p=1148950'),(18,1,'Watch The First Donut In Space','http://techcrunch.com/2015/04/24/watch-the-first-donut-in-space/?ncid=rss','John Biggs','<img width=\"680\" height=\"369\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/screen-shot-2015-04-24-at-8-35-47-am.png?w=680\" class=\"attachment-large wp-post-image\" alt=\"Screen Shot 2015-04-24 at 8.35.47 AM\" />&nbsp;It&#8217;s hard to believe that a month ago humans were unable to launch a donut into space. It was March 2015 and the world was in turmoil. Space travel was but a dream for even the richest pastry and we humans would never be able to grasp the concept of &#8211; let alone plan the injection of &#8211; a pastry in space. How things have changed. Benjamin and Alexander Jönsson are brothers&hellip; <a href=\"http://techcrunch.com/2015/04/24/watch-the-first-donut-in-space/?ncid=rss\">Read More</a>',1429879672,'http://techcrunch.com/?p=1148957'),(19,1,'Apple Watch Ad Philosophy','http://techcrunch.com/2015/04/24/apple-watch-ad-philosophy/?ncid=rss','Matthew Panzarino','<img width=\"680\" height=\"375\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/screen-shot-2015-04-24-at-6-17-07-am.png?w=680\" class=\"attachment-large wp-post-image\" alt=\"Screen Shot 2015-04-24 at 6.17.07 AM\" />&nbsp;Three new Apple Watch ads are hitting today and they stray far from the ascetic materials-oriented introduction spot. All three focus on showing the Watch integrating into regular human life rather than floating on an endless sea of white. These spots emphasize things I&#8217;ve noticed about the Watch so far, namely that it&#8217;s going to work best when it organically insinuates itself&hellip; <a href=\"http://techcrunch.com/2015/04/24/apple-watch-ad-philosophy/?ncid=rss\">Read More</a>',1429881561,'http://techcrunch.com/?p=1148970'),(20,1,'Comcast Confirms That Its Merger With Time Warner Cable Is Dead','http://techcrunch.com/2015/04/24/comcast-time-warner-is-dead/?ncid=rss','Anthony Ha','<img width=\"680\" height=\"510\" src=\"https://tctechcrunch2011.files.wordpress.com/2014/04/comcast-timewarner-angled.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"comcast-timewarner-angled\" />&nbsp;Comcast has dropped its plans to merge with Time Warner Cable.\nBloomberg reported yesterday that the deal was unraveling, following signs of opposition from the Justice Department and Federal Communications Commission. (Senator Al Franken actually wrote a post for TechCrunch earlier this week outlining his opposition to the deal.) <a href=\"http://techcrunch.com/2015/04/24/comcast-time-warner-is-dead/?ncid=rss\">Read More</a>',1429882403,'http://techcrunch.com/?p=1148972'),(21,1,'Apple Watch Diary','http://techcrunch.com/2015/04/24/apple-watch-diary/?ncid=rss','Matthew Panzarino,Darrell Etherington','<img width=\"680\" height=\"383\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/apple-watch-diary1.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"apple-watch-diary1\" />&nbsp;The Apple Watch made its debut on wrists around the world today &#8212; and people are unboxing and poking at it as we speak. Several of us here at TechCrunch have been doing the same with ours, and we&#8217;ll be documenting that over the next week or so. In order to give you a more holistic picture of what it&#8217;s like to use one day to day, and to give you a place to check in on our&#8230; <a href=\"http://techcrunch.com/2015/04/24/apple-watch-diary/?ncid=rss\">Read More</a>',1429883060,'http://techcrunch.com/?p=1148773'),(22,1,'Investors Swing For The Fences With $1B In Sports Tech Deals','http://techcrunch.com/2015/04/24/investors-swing-for-the-fences-with-1b-in-sports-tech-deals/?ncid=rss','Christine Magee','<img width=\"680\" height=\"525\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/hanley.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"hanley\" />&nbsp;From wearable activity trackers to fantasy e-sports, technology is transforming the way athletes train for the game and fans engage with their teams. With all of this momentum VCs are swinging for the fences. Investors have spent over $1 billion in venture deals for sports-related startups over the past year &#8212; and everyone wants in on the action. <a href=\"http://techcrunch.com/2015/04/24/investors-swing-for-the-fences-with-1b-in-sports-tech-deals/?ncid=rss\">Read More</a>',1429884348,'http://techcrunch.com/?p=1148974'),(23,1,'Apple Begins Offering Virtual “Personal Setup” Appointments To New Watch Owners','http://techcrunch.com/2015/04/24/apple-begins-offering-virtual-personal-setup-appointments-to-new-watch-owners/?ncid=rss','Sarah Perez','<img width=\"680\" height=\"453\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/applewatch-2.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"applewatch-2\" />&nbsp;As a number of early customers will receive their Apple Watch smartwatches today, Apple has also begun to send out email invitations offering &#8220;personal setup&#8221; appointments that take place via video sessions with an Apple Specialist. The sessions allow customers to learn about their new device and be walked through its features, as well as have the opportunity to ask&#8230; <a href=\"http://techcrunch.com/2015/04/24/apple-begins-offering-virtual-personal-setup-appointments-to-new-watch-owners/?ncid=rss\">Read More</a>',1429885087,'http://techcrunch.com/?p=1148979'),(24,1,'Apply Now For The Austin And Seattle Meetup + Pitch-Offs','http://techcrunch.com/2015/04/24/apply-now-to-pitch-at-the-austin-and-seattle-meetup-pitch-offs/?ncid=rss','Matt Burns','<img width=\"640\" height=\"449\" src=\"https://tctechcrunch2011.files.wordpress.com/2013/08/meetupseattle.jpg?w=640\" class=\"attachment-large wp-post-image\" alt=\"meetup=seattle\" />&nbsp;TechCrunch is headed back to Austin and Seattle in late June and we&#8217;re looking for a few good startups to pitch at the event. Is that you? Apply below. In past events in both of these cities people have shown up in droves, and with that sort of love we just can&#8217;t stay away. The Austin meetup happens on June 23 and Seattle on June 25th. We can&#8217;t wait. The goal is to bring&hellip; <a href=\"http://techcrunch.com/2015/04/24/apply-now-to-pitch-at-the-austin-and-seattle-meetup-pitch-offs/?ncid=rss\">Read More</a>',1429887642,'http://techcrunch.com/?p=1149012'),(25,1,'Headout Raises $1.8 Million For Its Travel App That Puts A Concierge In Your Pocket','http://techcrunch.com/2015/04/24/headout-raises-1-8-million-for-its-travel-app-that-puts-a-concierge-in-your-pocket/?ncid=rss','Sarah Perez','<img width=\"680\" height=\"453\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/app-promo.png?w=680\" class=\"attachment-large wp-post-image\" alt=\"App-Promo\" />&nbsp;Headout, a mobile travel application that functions as sort of a mobile concierge, helping you find tours, activities and tickets to local events in select U.S. cities, has closed on $1.8 million in seed funding in order to expand its business to new markets. Currently only live in New York and Los Angeles, the startup says it plans to utilize the funds to reach 12 more cities by year-end.&hellip; <a href=\"http://techcrunch.com/2015/04/24/headout-raises-1-8-million-for-its-travel-app-that-puts-a-concierge-in-your-pocket/?ncid=rss\">Read More</a>',1429891093,'http://techcrunch.com/?p=1149011'),(26,1,'BlackBerry Closing Design Operations In Sweden, Affecting Up To 150 Employees','http://techcrunch.com/2015/04/24/blackberry-closing-design-operations-in-sweden-affecting-up-to-150/?ncid=rss','Ingrid Lunden','<img width=\"680\" height=\"355\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/about6.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"about6\" />&nbsp;Earlier this week smartphone maker BlackBerry confirmed it acquired Israel&#8217;s WatchDox to build out its security software business, but it looks like it may be downsizing elsewhere. According to reports from Swedish news sites, BlackBerry is closing down its software design operations in Sweden &#8212; a business that grew out of its acquisition of UI startup The Astonishing&hellip; <a href=\"http://techcrunch.com/2015/04/24/blackberry-closing-design-operations-in-sweden-affecting-up-to-150/?ncid=rss\">Read More</a>',1429891124,'http://techcrunch.com/?p=1148975'),(27,1,'The 22 Best Apple Watch Health And Fitness Apps','http://techcrunch.com/2015/04/24/the-22-best-apple-watch-health-and-fitness-apps/?ncid=rss','Sarah Buhr','<img width=\"680\" height=\"389\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/screen-shot-2015-04-22-at-3-56-54-pm1.png?w=680\" class=\"attachment-large wp-post-image\" alt=\"Screen Shot 2015-04-22 at 3.56.54 PM\" />&nbsp;In case you haven&#8217;t heard, the Apple Watch, Apple&#8217;s first step into the world of wearables, starts shipping to consumers today. The Watch marks an interesting time in the wearable fitness space, in particular. Health and fitness trackers like Jawbone Up and Fitbit have dominated much of that space in the last few years. According to NDP, these wearable fitness devices sold close&hellip; <a href=\"http://techcrunch.com/2015/04/24/the-22-best-apple-watch-health-and-fitness-apps/?ncid=rss\">Read More</a>',1429892708,'http://techcrunch.com/?p=1148245'),(28,1,'Google Works To Improve Spam Detection Systems On Google Maps After Obscene Edits','http://techcrunch.com/2015/04/24/google-works-to-improve-spam-detection-systems-on-google-maps-after-obscene-edits/?ncid=rss','Sarah Perez','<img width=\"680\" height=\"353\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/screen-shot-2015-04-24-at-1-13-46-pm.png?w=680\" class=\"attachment-large wp-post-image\" alt=\"Screen Shot 2015-04-24 at 1.13.46 PM\" />&nbsp;Google says it&#8217;s working to improve its spam-detection systems in its Google Maps platform after yet another prank allowed a user to upload an inappropriate image to Google Maps. This most recent image, which showed the Google Android mascot urinating on the Apple logo in the style of those unfortunate Calvin and Hobbes bootleg decals, was apparently uploaded by a Map Maker user&#8230; <a href=\"http://techcrunch.com/2015/04/24/google-works-to-improve-spam-detection-systems-on-google-maps-after-obscene-edits/?ncid=rss\">Read More</a>',1429895946,'http://techcrunch.com/?p=1149039'),(29,1,'Microsoft And Google Battle Once Again For Title Of Second Most Valuable Tech Company','http://techcrunch.com/2015/04/24/microsoft-and-google-battle-once-again-for-title-of-second-most-valuable-tech-company/?ncid=rss','Alex Wilhelm','<img width=\"680\" height=\"453\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/03/2856173673_27b7e5e521_o.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"Google\" />&nbsp;They&#8217;re back at it. After reporting earnings yesterday, Google and Microsoft are once again locked in their long-running battle for second. Apple, the most valuable technology company, is also the most valuable company in the world, with Google and Microsoft rounding off the top three. Google, up 3.56 percent as of the time of writing, is currently worth $385.59 billion. Microsoft, up&hellip; <a href=\"http://techcrunch.com/2015/04/24/microsoft-and-google-battle-once-again-for-title-of-second-most-valuable-tech-company/?ncid=rss\">Read More</a>',1429897200,'http://techcrunch.com/?p=1149064'),(30,1,'Welcome To The Age Of 4D Printers','http://techcrunch.com/2015/04/24/welcome-to-the-age-of-4d-printers/?ncid=rss','John Biggs','<img width=\"680\" height=\"394\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/90659_web.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"90659_web\" />&nbsp;Welcome to Future World where the weird is commonplace! To wit: engineers at the ARC Centre of Excellence for Electromaterials Science have created a 4D printer. That doesn&#8217;t mean the printer outputs objects into the space-time continuum. Instead, it means they are building objects that can change based on the physics of the materials used. By extruding objects in multiple materials,&hellip; <a href=\"http://techcrunch.com/2015/04/24/welcome-to-the-age-of-4d-printers/?ncid=rss\">Read More</a>',1429905236,'http://techcrunch.com/?p=1149167'),(31,1,'Valve’s Launch Of Paid Mods Faces Backlash From Community','http://techcrunch.com/2015/04/24/valves-launch-of-paid-mods-faces-backlash-from-community/?ncid=rss','Kyle Russell','<img width=\"680\" height=\"524\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/screen-shot-2015-04-24-at-11-49-31-am.png?w=680\" class=\"attachment-large wp-post-image\" alt=\"Steam Paid Game Mods\" />&nbsp;PC gaming giant Valve is facing vocal backlash from its community a day after giving developers of game modifications the ability to charge for their work on the Steam platform. <a href=\"http://techcrunch.com/2015/04/24/valves-launch-of-paid-mods-faces-backlash-from-community/?ncid=rss\">Read More</a>',1429906048,'http://techcrunch.com/?p=1149130'),(32,1,'Gillmor Gang LIVE 04.24.15','http://techcrunch.com/2015/04/24/gillmor-gang-live-04-24-15/?ncid=rss','Steve Gillmor','<img width=\"680\" height=\"383\" src=\"https://tctechcrunch2011.files.wordpress.com/2014/02/gg-test-pattern-sepia3.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"Gillmor Gang Artcard\" />&nbsp;Gillmor Gang &#8211; Danny Sullivan, Robert Scoble, Dan Farber, John Taschek, and Steve Gillmor. LIVE recording session has concluded for today.  \nOur live chat during show broadcast \nGillmor Gang on Facebook\nOur sister show G3 on Facebook\n\nArchives of G3 on Ustream <a href=\"http://techcrunch.com/2015/04/24/gillmor-gang-live-04-24-15/?ncid=rss\">Read More</a>',1429906106,'http://techcrunch.com/?p=1149014'),(33,1,'Apple Watch Keeps Ticking After 15 Minutes Under Water','http://techcrunch.com/2015/04/24/apple-watch-keeps-ticking-after-15-minutes-under-water/?ncid=rss','Greg Kumparak','<img width=\"680\" height=\"378\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/water.png?w=680\" class=\"attachment-large wp-post-image\" alt=\"water\" />&nbsp;It&#8217;s a hot day. You jump into a swimsuit, hop into the pool, and&#8230; suddenly remember that your Apple Watch is still on your wrist.\nWell, crap &#8212; $600 wrist computer ruined, right? Nope. <a href=\"http://techcrunch.com/2015/04/24/apple-watch-keeps-ticking-after-15-minutes-under-water/?ncid=rss\">Read More</a>',1429907266,'http://techcrunch.com/?p=1149186'),(34,1,'Apigee Closes Its First Public Day Worth $16.68 Per Share, Down 1.9% From Its IPO Price','http://techcrunch.com/2015/04/24/apigee-closes-its-first-public-day-worth-16-68-per-share-down-1-9-percent-from-its-ipo-price/?ncid=rss','Ron Miller,Alex Wilhelm','<img width=\"680\" height=\"369\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/apigee-goes-public.png?w=680\" class=\"attachment-large wp-post-image\" alt=\"Apigee team at Nasdaq as the company IPOs this morning.\" />&nbsp;Apigee, a company that helps organizations build and manage API connectors, went public this morning at $17 per share, briefly jumping to $20 per share before closing at $16.68, down 1.88 percent in its first day of regular trading. After-hours, the company is flat.\nThe company sold 5,115,000 shares in its IPO, raising $87M according to its CEO Chet Kapoor. It trades under the symbol&#8230; <a href=\"http://techcrunch.com/2015/04/24/apigee-closes-its-first-public-day-worth-16-68-per-share-down-1-9-percent-from-its-ipo-price/?ncid=rss\">Read More</a>',1429907720,'http://techcrunch.com/?p=1149116'),(35,1,'Shinola, Grado Labs, And Adafruit To Talk Making And Manufacturing At Disrupt NY','http://techcrunch.com/2015/04/24/shinola-grado-labs-and-adafruit-to-talk-making-and-manufacturing-at-disrupt-ny/?ncid=rss','Matt Burns','<img width=\"680\" height=\"449\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/fried-grado-panis.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"fried-grado-panis\" />&nbsp;Manufacturing never left America. Even during the recession, good people were still building good things. Recently, though, thanks to the maker movement, small-scale manufacturing is seeing a renaissance throughout the world, something the president of Shinola, Vice President of Grado Labs, and founder of Adafruit will discuss at Disrupt NY. Each of these people have a unique vantage point on&hellip; <a href=\"http://techcrunch.com/2015/04/24/shinola-grado-labs-and-adafruit-to-talk-making-and-manufacturing-at-disrupt-ny/?ncid=rss\">Read More</a>',1429908710,'http://techcrunch.com/?p=1148967'),(36,1,'13 TechCrunch Stories You Don’t Want To Miss This Week','http://techcrunch.com/2015/04/24/13-techcrunch-stories-you-dont-want-to-miss-this-week-6/?ncid=rss','Anna Escher','<img width=\"680\" height=\"383\" src=\"https://tctechcrunch2011.files.wordpress.com/2014/08/tc-weekly-roundup1.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"TC-weekly-roundup1\" />&nbsp;This week, Apple Watch deliveries officially arrived to the first pre-order customers, Q1 earnings were released and Google announced its wireless cell service Project Fi. These were our best stories of the week (4/18-4/24). <a href=\"http://techcrunch.com/2015/04/24/13-techcrunch-stories-you-dont-want-to-miss-this-week-6/?ncid=rss\">Read More</a>',1429909239,'http://techcrunch.com/?p=1149113'),(37,1,'Why WeChat City Services Is A Game-Changing Move For Smartphone Adoption','http://techcrunch.com/2015/04/24/why-wechat-city-services-is-a-game-changing-move-for-smartphone-adoption/?ncid=rss','Tudor Stanciu','<img width=\"680\" height=\"510\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/multitool.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"multitool\" />&nbsp;Last month, WeChat launched City Services in select towns across China &#8211; if you&#8217;re already a user of WeChat, simply change your location to one of the three pilot cities and the language to Chinese and you&#8217;ll be presented with a wide array of additional services that may be accessed from right within the app. As the name says it, it basically is trying to solve all problems&hellip; <a href=\"http://techcrunch.com/2015/04/24/why-wechat-city-services-is-a-game-changing-move-for-smartphone-adoption/?ncid=rss\">Read More</a>',1429909256,'http://techcrunch.com/?p=1145740'),(38,1,'CrunchWeek: Zenefits Loves Cash, Everyone’s Watching Apple, And Amazon’s Epic Quarterly Report','http://techcrunch.com/2015/04/24/crunchweek-zenefits-loves-cash-everyones-watching-apple-and-amazons-epic-quarterly-report/?ncid=rss','Alex Wilhelm,Kyle Russell,Colleen Taylor','<img width=\"680\" height=\"510\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/02/crunchweek-4-3.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"crunchweek-4-3\" />&nbsp;Another week has left us in a miasma of earnings, product releases, and something called the Apple Watch. As such, it&#8217;s the perfect time to sit around our little round table we keep in the back of TechCrunch, and kick over the most important stories of the week: Amazon&#8217;s massively popular quarter, Zenefits&#8217; massive capital raise, and, yes, the Apple Watch.\nThis time around&#8230; <a href=\"http://techcrunch.com/2015/04/24/crunchweek-zenefits-loves-cash-everyones-watching-apple-and-amazons-epic-quarterly-report/?ncid=rss\">Read More</a>',1429909277,'http://techcrunch.com/?p=1149194'),(39,1,'An Early Look At The Apple Watch App Ecosystem','http://techcrunch.com/2015/04/24/an-early-look-at-the-apple-watch-app-ecosystem/?ncid=rss','Sarah Perez','<img width=\"680\" height=\"510\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/watch-nav-screen.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"watch-nav-screen\" />&nbsp;With the Apple Watch now officially on the market, and soon to be on the wrists of several million customers &#8211; possibly as many as 20 million this year, according to some estimates &#8211; there&#8217;s a lot of curiosity about what kind of app ecosystem will spring up around the new device. Will Apple Watch owners actually be interested in actively reading news, shopping or playing&hellip; <a href=\"http://techcrunch.com/2015/04/24/an-early-look-at-the-apple-watch-app-ecosystem/?ncid=rss\">Read More</a>',1429910845,'http://techcrunch.com/?p=1149175'),(40,1,'Instagram Cuts Off Hot GIF App Phhhoto From Its Social Graph','http://techcrunch.com/2015/04/24/nochill/?ncid=rss','Josh Constine','<img width=\"680\" height=\"355\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/instagram-cuts-off-phhhoto.gif?w=680\" class=\"attachment-large wp-post-image\" alt=\"Instagram Cuts Off Phhhoto\" />&nbsp;&#8220;Removed instagram friend-finding cause they blocked us! #nochill&#8221; This note in hip GIF app Phhhoto&#8216;s latest release notes was how it announced its users can no longer easily follow their Instagram friends. Instagram confirmed to me that it has blocked Phhhoto&#8217;s Find Friends access, but it has a policy of not discussing platform enforcement issues regarding specific&#8230; <a href=\"http://techcrunch.com/2015/04/24/nochill/?ncid=rss\">Read More</a>',1429912303,'http://techcrunch.com/?p=1149158'),(41,1,'Introducing TechCrunch TV Live From Disrupt NY','http://techcrunch.com/2015/04/24/introducing-techcrunch-tv-live-from-disrupt-ny/?ncid=rss','Sarah Lane','<img width=\"680\" height=\"452\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/screen-shot-2015-04-24-at-10-27-46.png?w=680\" class=\"attachment-large wp-post-image\" alt=\"Screen Shot 2015-04-24 at 10.27.46\" />&nbsp;Disrupt NY 2015 is days away and we&#8217;re thrilled to announce the TechCrunch video team will be broadcasting interviews, updates, and great startup action live from the Exhibit Hall floor. In the past, our video team&#160;has been hidden backstage, occasionally sneaking out from inside a secret lair with cameras and microphones. This year TechCrunch TV Live will quite literally be in&hellip; <a href=\"http://techcrunch.com/2015/04/24/introducing-techcrunch-tv-live-from-disrupt-ny/?ncid=rss\">Read More</a>',1429913522,'http://techcrunch.com/?p=1148816'),(42,1,'Oculus Co-Founder Nate Mitchell Will Give Disrupt NY The Real Deal On Virtual Reality','http://techcrunch.com/2015/04/24/oculus-rift-release/?ncid=rss','Josh Constine','<img width=\"680\" height=\"356\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/nate-mitchell1.png?w=680\" class=\"attachment-large wp-post-image\" alt=\"Nate Mitchell\" />&nbsp;Oculus is getting ready to launch its consumer Rift virtual reality headset so at TechCrunch Disrupt NY I&#8217;ll be sitting down with the man who made it. Nate Mitchell is the co-founder and VP of Product at Oculus. While visionary Palmer Luckey and CEO Brendan Iribe get a lot of attention, its Mitchell who&#8217;s in charge of engineering, product, its Story Studio content team, and making&hellip; <a href=\"http://techcrunch.com/2015/04/24/oculus-rift-release/?ncid=rss\">Read More</a>',1429916351,'http://techcrunch.com/?p=1149115'),(43,1,'Yahoo Researchers Use A Phone’s Touchscreen To Scan The Ear Like A Fingerprint','http://techcrunch.com/2015/04/24/yahoo-researchers-use-a-phones-touchscreen-to-scan-the-ear-like-a-fingerprint/?ncid=rss','Greg Kumparak','<img width=\"680\" height=\"387\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/ear.png?w=680\" class=\"attachment-large wp-post-image\" alt=\"ear\" />&nbsp;What if your phone could let you &#8212; and only you &#8212; answer an incoming call, no thumb print/PIN/swipe gesture required? Instead of a finger, it&#8217;d gauge the shape of your ear; instead of a fingerprint sensor, it&#8217;d use the touchscreen your phone already has built-in.\nThat&#8217;s the idea behind Bodyprint, a new concept out of Yahoo&#8217;s research labs. <a href=\"http://techcrunch.com/2015/04/24/yahoo-researchers-use-a-phones-touchscreen-to-scan-the-ear-like-a-fingerprint/?ncid=rss\">Read More</a>',1429919514,'http://techcrunch.com/?p=1149258'),(44,1,'Commandments For The Speed Of Security','http://techcrunch.com/2015/04/24/commandments-for-the-speed-of-security/?ncid=rss','Steve Herrod','<img width=\"680\" height=\"383\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/commandments.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"commandments\" />&nbsp;PF Chang&#8217;s. Domino&#8217;s. eBay. Home Depot. Nieman Marcus. Sony. That isn&#8217;t just a list of wildly successful companies, it&#8217;s also a list of hacked companies; companies whose security was profoundly, publicly compromised. And it&#8217;s just a very small sample of a much larger set. The problem is not just that our industry&#8217;s approach to security is compromised but a&hellip; <a href=\"http://techcrunch.com/2015/04/24/commandments-for-the-speed-of-security/?ncid=rss\">Read More</a>',1429923632,'http://techcrunch.com/?p=1145748'),(45,1,'We Are All Venture Capitalists Now','http://techcrunch.com/2015/04/25/we-are-all-venture-capitalists-now/?ncid=rss','Jon Evans','<img width=\"680\" height=\"452\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/joust.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"joust\" />&nbsp;&#8220;I would again draw an analogy to venture capital,&#8221; observes Ben Thompson, in a typically incisive Stratechery post eviscerating the new streaming service Tidal. &#8220;The importance&#8211;and amount&#8211;of venture capital has never been greater. The truth is that because so many folks can now get started it is that much harder&#8211;and more expensive&#8211;to cut through&hellip; <a href=\"http://techcrunch.com/2015/04/25/we-are-all-venture-capitalists-now/?ncid=rss\">Read More</a>',1429966808,'http://techcrunch.com/?p=1148841'),(46,1,'Fliplet Secures Seed Funding For Its ‘Fast’ Enterprise Apps Building Platform','http://techcrunch.com/2015/04/25/fliplet-secures-seed-funding-for-its-fast-enterprise-apps-building-platform/?ncid=rss','Mike Butcher','<img width=\"680\" height=\"453\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/team-1.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"Team-1\" />&nbsp;You&#8217;re a business that wants to create a mobile app, but faster than it would take a designer to build something bespoke. UK-based startup Fliplet says it has come up with a simple way to do this which is mainly used by companies to produce internal business apps, such as to support sales, reporting, training, marketing, stuff like that. Existing customers include Marriott, Mars, Xerox&hellip; <a href=\"http://techcrunch.com/2015/04/25/fliplet-secures-seed-funding-for-its-fast-enterprise-apps-building-platform/?ncid=rss\">Read More</a>',1429971761,'http://techcrunch.com/?p=1149303'),(47,1,'Splittable App Makes A Play For Renters Who Have To Split Apartment Costs','http://techcrunch.com/2015/04/25/splittable-app-makes-a-play-for-renters-who-have-to-split-apartment-costs/?ncid=rss','Mike Butcher','<img width=\"654\" height=\"461\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/screen-shot-2015-04-25-at-17-54-04.png?w=654\" class=\"attachment-large wp-post-image\" alt=\"Screen Shot 2015-04-25 at 17.54.04\" />&nbsp;We&#8217;ve seen how Venmo has taken off in the US for when people want to split things like shared restaurant bills. Now a UK startup has come up with an app which it claims will make it easier to share expenses when sharing an apartment. According to the UK&#8217;s Office of National Statistics, the country has over ten million young renters driven into sharing apartments because of&hellip; <a href=\"http://techcrunch.com/2015/04/25/splittable-app-makes-a-play-for-renters-who-have-to-split-apartment-costs/?ncid=rss\">Read More</a>',1429972794,'http://techcrunch.com/?p=1149306'),(48,1,'The Apple Watch Can Be A Sixth Sense','http://techcrunch.com/2015/04/25/the-apple-watch-can-be-a-sixth-sense/?ncid=rss','Dan Kaplan','<img width=\"680\" height=\"453\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/psychic.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"psychic\" />&nbsp;The world around us is screaming with signals our original five senses don&#8217;t detect. Unlike some snakes, we can&#8217;t sense infrared with our naked eyes and unlike ducks and geese, we don&#8217;t have a native intuition for magnetic fields. But we&#8217;ve got pretty incredible brains, which we&#8217;ve used to craft ways to augment our five basic senses for a very long time. <a href=\"http://techcrunch.com/2015/04/25/the-apple-watch-can-be-a-sixth-sense/?ncid=rss\">Read More</a>',1429974002,'http://techcrunch.com/?p=1145808'),(49,1,'Is Seattle Silicon Valley’s Next Favorite Stop?','http://techcrunch.com/2015/04/25/is-seattle-silicon-valleys-next-favorite-stop/?ncid=rss','Hadi Partovi','<img width=\"680\" height=\"453\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/3046028613_6efa31be58_o.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"3046028613_6efa31be58_o\" />&nbsp;In the last ten years, the Seattle tech scene has changed quite dramatically. In the 1990s and early 2000s, the only gigantic software companies in town were Microsoft and Amazon. For a time it even became common knowledge that most Seattle-based startups had only two viable exit strategies: go public, or get acquired by Microsoft. <a href=\"http://techcrunch.com/2015/04/25/is-seattle-silicon-valleys-next-favorite-stop/?ncid=rss\">Read More</a>',1429979454,'http://techcrunch.com/?p=1149288'),(50,1,'Gillmor Gang: Time Machine','http://techcrunch.com/2015/04/25/gillmor-gang-time-machine/?ncid=rss','Steve Gillmor','<img width=\"680\" height=\"383\" src=\"https://tctechcrunch2011.files.wordpress.com/2014/02/gg-test-pattern-sepia3.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"Gillmor Gang Artcard\" />&nbsp;The Gillmor Gang &#8212; Danny Sullivan, Robert Scoble, Dan Farber, John Taschek, and Steve Gillmor. Recorded live Friday, April 24, 2015. We got nothing but time on our hands waiting for the one on our wrists.  Plus, the latest G3 (below) with Halley Suitt Tucker, Denise Howell, Mary Hodder, Rebecca Woodcock, and Tina Gillmor.\n@stevegillmor, @scobleizer, @dannysullivan, @jtaschek, @dbfarber <a href=\"http://techcrunch.com/2015/04/25/gillmor-gang-time-machine/?ncid=rss\">Read More</a>',1429982186,'http://techcrunch.com/?p=1149316'),(51,1,'Slideshow: The Cinder Sensing Cooker Won’t Burn Your Food To A Crisp','http://techcrunch.com/2015/04/25/slideshow-the-cinder-sensing-cooker-wont-burn-your-food-to-a-crisp/?ncid=rss','John Biggs','<img width=\"680\" height=\"453\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/img_52441.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"img_5244\" />&nbsp;I&#8217;m a lucky lad. Every so often the creators of a really cool, really revolutionary cooking devices come to my house and make me food and this time it was Cinder. Think of Cinder as a George Foreman Grill that went to MIT. Designed to cook everything perfectly, the system can cook, sear, and grill automatically, allowing you to place food in the machine and have it cooked to perfection&hellip; <a href=\"http://techcrunch.com/2015/04/25/slideshow-the-cinder-sensing-cooker-wont-burn-your-food-to-a-crisp/?ncid=rss\">Read More</a>',1429989354,'http://techcrunch.com/?p=1143656'),(52,1,'Game Of Angels Maps Tech Influence Networks','http://techcrunch.com/2015/04/25/game-of-angels/?ncid=rss','Natasha Lomas','<img width=\"680\" height=\"424\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/screen-shot-2015-04-24-at-7-07-03-pm.png?w=680\" class=\"attachment-large wp-post-image\" alt=\"Game of Angels\" />&nbsp;Ever wondered who influences the influencers? Developer Pierre-Jean Camillieri did, so he put together a tool that scrapes public Twitter and Angel List interactions to map inbound and outbound connections between technology investors, journalists and analysts to foreground influence networks. <a href=\"http://techcrunch.com/2015/04/25/game-of-angels/?ncid=rss\">Read More</a>',1429995647,'http://techcrunch.com/?p=1148954'),(53,1,'The Marijuana Industry And Its First Crossroads','http://techcrunch.com/2015/04/25/the-marijuana-industry-and-its-first-crossroads/?ncid=rss','Alex Thiersch','<img width=\"680\" height=\"453\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/weedtomatoes.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"weedtomatoes\" />&nbsp;Marijuana has come a long way in the United States since California launched its first-in-the-nation medical program 19 years ago. Today, 23 states and the District of Columbia have legalized cannabis to some degree, and public perception of the plant is clearly shifting. Medical marijuana is being used in treatment of a variety of illnesses including several types of seizures, cancer and&#8230; <a href=\"http://techcrunch.com/2015/04/25/the-marijuana-industry-and-its-first-crossroads/?ncid=rss\">Read More</a>',1429995651,'http://techcrunch.com/?p=1145755'),(54,1,'Tesla’s Site And Twitter Account Hacked','http://techcrunch.com/2015/04/25/teslas-site-and-twitter-account-hacked/?ncid=rss','Greg Kumparak','<img width=\"680\" height=\"434\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/tesla.png?w=680\" class=\"attachment-large wp-post-image\" alt=\"tesla\" />&nbsp;Looks like it&#8217;s going to be a rough Saturday for Tesla&#8217;s IT department: they&#8217;ve just had both their website and Twitter account hijacked. <a href=\"http://techcrunch.com/2015/04/25/teslas-site-and-twitter-account-hacked/?ncid=rss\">Read More</a>',1429998155,'http://techcrunch.com/?p=1149337'),(55,1,'What The U.S. Can Learn From Europe’s Growing Commercial Drone Industry','http://techcrunch.com/2015/04/25/what-the-u-s-can-learn-from-europes-growing-commercial-drone-industry/?ncid=rss','Michael Dahmen','<img width=\"680\" height=\"324\" src=\"https://tctechcrunch2011.files.wordpress.com/2013/12/2drones.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"2drones\" />&nbsp;Drones are an auspicious future technology that can service a vast number of professional industries. Businesses around the world are discovering the great benefits that drones can provide. However there is a notable difference in the economic growth of the drone industry in Europe compared to the rest of the world. For example, in Europe, the number of companies deploying drones for&hellip; <a href=\"http://techcrunch.com/2015/04/25/what-the-u-s-can-learn-from-europes-growing-commercial-drone-industry/?ncid=rss\">Read More</a>',1430006455,'http://techcrunch.com/?p=1145937'),(56,1,'Slightly Slighted, Apple’s Diehards Still Do The Launch Day Lineup','http://techcrunch.com/2015/04/25/slightly-slighted-apples-diehards-still-do-the-launch-day-lineup/?ncid=rss','Fitz Tepper','<img width=\"680\" height=\"510\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/1.jpeg?w=680\" class=\"attachment-large wp-post-image\" alt=\"1\" />&nbsp;While the atmosphere outside the store was generally similar to previous launches, a glaring difference was the fact that I wasn&#8217;t waiting outside of an Apple Store. I was sitting on the sidewalk outside of the upscale fashion boutique Maxfield, on trendy Melrose Avenue in Los Angeles. <a href=\"http://techcrunch.com/2015/04/25/slightly-slighted-apples-diehards-still-do-the-launch-day-lineup/?ncid=rss\">Read More</a>',1430011854,'http://techcrunch.com/?p=1149296'),(57,1,'A Journey To Intelligent Design','http://techcrunch.com/2015/04/25/intelligent-design/?ncid=rss','Stephen Marshall','<img width=\"680\" height=\"416\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/shutterstock_94007068.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"image: shutterstock/majcot\" />&nbsp;If you&#8217;re looking for zeitgeist Biblical metaphors for the tech sector, you can&#8217;t do much better than the Tower of Babel. Human civilization a hundred years after the Flood; monolingual and gathered in a city called Babel. They become possessed with the mission of building a tower to the heavens. Which they begin… <a href=\"http://techcrunch.com/2015/04/25/intelligent-design/?ncid=rss\">Read More</a>',1430020836,'http://techcrunch.com/?p=1145946'),(58,1,'Xiaomi Boosts Its Business In India With Strategic Investment From Tata Sons Head','http://techcrunch.com/2015/04/26/xiaomi-ratan-tata-investment/?ncid=rss','Jon Russell','<img width=\"680\" height=\"383\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/rata-tata-xiaomi.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"rata tata xiaomi\" />&nbsp;Xiaomi is making a push to be a local player in India. Days after unveiling its first phone customized to the South Asia country (the impressive $205 Mi 4i), Xiaomi announced that it has taken investment from leading Indian businessman Ratan Tata. <a href=\"http://techcrunch.com/2015/04/26/xiaomi-ratan-tata-investment/?ncid=rss\">Read More</a>',1430037822,'http://techcrunch.com/?p=1149378'),(59,1,'Hello?! Nokia Releases Official Statement Denying Reports It Will Return To Mobile Handsets','http://techcrunch.com/2015/04/26/hello-nokia-releases-official-statement-denying-reports-it-will-return-to-mobile-handsets/?ncid=rss','Mike Butcher','<img width=\"468\" height=\"299\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/dom-joly-phone.jpg?w=468\" class=\"attachment-large wp-post-image\" alt=\"dom-joly-phone\" />&nbsp;Nokia sold its handset business to Microsoft last year, but since then rumours have bubbled up now and again that the firm is planning to return to the mobile space. Citing anonymous sources, Re/code recently lit the touch-paper on a round of new stories floating this idea. It reported that the firm was plotting more mobile moves, spearheaded by Nokia Technologies, the division which handles&hellip; <a href=\"http://techcrunch.com/2015/04/26/hello-nokia-releases-official-statement-denying-reports-it-will-return-to-mobile-handsets/?ncid=rss\">Read More</a>',1430048741,'http://techcrunch.com/?p=1149389'),(60,1,'Don’t Turn Internet Independence Into Government Dependence','http://techcrunch.com/2015/04/26/dont-turn-internet-independence-into-government-dependence/?ncid=rss','Daniel Berninger','<img width=\"680\" height=\"444\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/internetfreedom.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"internetfreedom\" />&nbsp;April marks the 20th anniversary of the commercialization of the Internet, ironically, the very same month that the Federal Communications Commission&#8217;s new Open Internet regulations were officially published, tossing the Internet into a public utility model characterized by stagnation and ambiguity. The rules kill the &#8220;permissionless innovation&#8221; they purport to protect by&#8230; <a href=\"http://techcrunch.com/2015/04/26/dont-turn-internet-independence-into-government-dependence/?ncid=rss\">Read More</a>',1430053203,'http://techcrunch.com/?p=1145956'),(61,1,'Google Executive Dan Fredinburg Dies In Everest Avalanche After Nepal Earthquake','http://techcrunch.com/2015/04/26/google-executive-dan-fredinburg-dies-in-everest-avalanche-after-nepal-earthquake/?ncid=rss','Mike Butcher','<img width=\"601\" height=\"605\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/screen-shot-2015-04-26-at-13-48-35.png?w=601\" class=\"attachment-large wp-post-image\" alt=\"Screen Shot 2015-04-26 at 13.48.35\" />&nbsp;Dan Fredinburg, a respected Google executive who headed privacy for Google X and lead its product management team, has died in the avalanche on Mount Everest which was triggered by the huge earthquake in Nepal. The natural disaster has already killed over 2,000 people in the region and devastated infrastructure. Some 18 other climbers have been killed in what is being described as the worst&#8230; <a href=\"http://techcrunch.com/2015/04/26/google-executive-dan-fredinburg-dies-in-everest-avalanche-after-nepal-earthquake/?ncid=rss\">Read More</a>',1430055483,'http://techcrunch.com/?p=1149392'),(62,1,'You Need To Be A Billion Just To Make A Million','http://techcrunch.com/2015/04/26/you-need-to-be-a-billion-just-to-make-a-million/?ncid=rss','Danny Crichton','<img width=\"680\" height=\"453\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/5310895988_fbe55be401_o.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"5310895988_fbe55be401_o\" />&nbsp;I always love peering into the world of executive recruiting. As a grad student and as a writer, the thought that there are people out there chasing other people to get them to work at massive wages always seemed to me like a bounty hunter scene out of a strange science fiction movie. Sometimes the wages offered are as much as $1 million; sometimes, that&#8217;s not enough. Competition in&hellip; <a href=\"http://techcrunch.com/2015/04/26/you-need-to-be-a-billion-just-to-make-a-million/?ncid=rss\">Read More</a>',1430070006,'http://techcrunch.com/?p=1149404'),(63,1,'Back To The Future In Enterprise SaaS Selling','http://techcrunch.com/2015/04/26/back-to-the-future-in-enterprise-saas-selling/?ncid=rss','Nino Marakovic,Rajeev Dham','<img width=\"680\" height=\"450\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/bttf.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"bttf\" />&nbsp;Given the success of Box, it&#8217;s hard to imagine that founder Aaron Levie believes he should have done something differently in the company&#8217;s early years. However, while speaking to Storm Ventures&#8217; Jason Lemkin at this year&#8217;s SaaStr conference, Levie revealed exactly what he would have changed. Although it is somewhat hidden in the rest of the interview, Levie points out&hellip; <a href=\"http://techcrunch.com/2015/04/26/back-to-the-future-in-enterprise-saas-selling/?ncid=rss\">Read More</a>',1430071200,'http://techcrunch.com/?p=1145959'),(64,1,'The Micro VC Shakeout','http://techcrunch.com/2015/04/26/the-microvc-shakeout/?ncid=rss','Paul Martino','<img width=\"680\" height=\"526\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/droplets-e1429553501442.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"droplets\" />&nbsp;When we started Bullpen Capital in 2011, there were about 30 or so &#8220;microVC&#8221; or &#8220;micro-seed&#8221; funds &#8212; and we knew them all. Today, four years later, there are likely over 220 micro VC funds and growing. In fact, I joke with my partners that &#8220;we will likely get to 400 before we go back to 40.&#8221; That line always elicits a nervous laughter, as it captures&hellip; <a href=\"http://techcrunch.com/2015/04/26/the-microvc-shakeout/?ncid=rss\">Read More</a>',1430085609,'http://techcrunch.com/?p=1145977'),(65,1,'Silicon Valley Can Accelerate Social Impact Globally','http://techcrunch.com/2015/04/26/silicon-valley-can-accelerate-social-impact-globally/?ncid=rss','Doug Galen','<img width=\"680\" height=\"453\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/10147539996_aae6fc5ae6_k-1.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"10147539996_aae6fc5ae6_k (1)\" />&nbsp;Silicon Valley&#8217;s influence is undeniable but its global impact has always been a passive byproduct of success at home. To make a lasting, material difference, there needs to be a concerted effort to expand its reach in a substantial and sustainable way.\nFor the better part of the last century, the Valley has been a bedrock for technological progress and era-defining industry. From the&#8230; <a href=\"http://techcrunch.com/2015/04/26/silicon-valley-can-accelerate-social-impact-globally/?ncid=rss\">Read More</a>',1430082022,'http://techcrunch.com/?p=1149432'),(66,1,'Internet Privacy Is The Wrong Conversation','http://techcrunch.com/2015/04/26/internet-privacy-is-the-wrong-conversation/?ncid=rss','Rami Essaid','<img width=\"680\" height=\"481\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/privateeye.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"privateeye\" />&nbsp;On April 2, the Wall Street Journal reported that Facebook is in hot water with government regulators in six European countries over its practice of tracking users&#8217; movements across the web to sell targeted advertising. The kerfuffle illustrates the bind that the world finds itself in over tracking &#8211; the collection and sharing of data on users&#8217; browsing habits to help sites&hellip; <a href=\"http://techcrunch.com/2015/04/26/internet-privacy-is-the-wrong-conversation/?ncid=rss\">Read More</a>',1430096423,'http://techcrunch.com/?p=1145980'),(67,1,'uBeam’s Ultrasound Wireless Charging Is Real, And About To Be Really Funded','http://techcrunch.com/2015/04/26/kill-the-cord/?ncid=rss','Josh Constine','<img width=\"680\" height=\"383\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/power-cord.png?w=680\" class=\"attachment-large wp-post-image\" alt=\"power-cord\" />&nbsp;What if wireless power at a distance actually worked? It does. uBeam invented a way to wirelessly send energy up to 15 feet away with ultrasound. What if you could slap a wireless charging case on your phone and charge it while you move around or use it? uBeam invented that too. While early uBeam prototype were massive, non-portable boxes that merely shot power around, it now has a working&hellip; <a href=\"http://techcrunch.com/2015/04/26/kill-the-cord/?ncid=rss\">Read More</a>',1430099128,'http://techcrunch.com/?p=1148822'),(68,1,'Bitcoin’s Q1: Record VC Investment, Falling Prices, And Slow Consumer Adoption','http://techcrunch.com/2015/04/26/bitcoins-q1-record-vc-investment-falling-prices-and-slow-consumer-adoption/?ncid=rss','Alex Wilhelm','<img width=\"680\" height=\"510\" src=\"https://tctechcrunch2011.files.wordpress.com/2014/09/bitcoin-mountain-rise.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"bitcoin-mountain-rise\" />&nbsp;The bitcoin-watching news service CoinDesk recently released its first quarter look into the cryptocurrency&#8217;s performance during the opening months of 2015. Mostly the data is net positive, showing an increase in total wallets, and investment. However, there are a number of included data points that demonstrate slowing growth in key bitcoin, and bitcoin-related areas. The collected&hellip; <a href=\"http://techcrunch.com/2015/04/26/bitcoins-q1-record-vc-investment-falling-prices-and-slow-consumer-adoption/?ncid=rss\">Read More</a>',1430105605,'http://techcrunch.com/?p=1149474'),(69,1,'Freelancer.com Acquires Payment Service Provider Escrow.com For $7.5M','http://techcrunch.com/2015/04/26/freelancer-acquires-escrow/?ncid=rss','Catherine Shu','<img width=\"680\" height=\"453\" src=\"https://tctechcrunch2011.files.wordpress.com/2014/08/picjumbo-com_img_6779.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"Photo by PicJumbo\" />&nbsp;Job marketplace Freelancer.com announced today that it has agreed to purchased Escrow.com for $7.5 million in cash. The acquisition was funded by through an placement of $10 million AUD (about $7.8 million) in ordinary shares of Freelancer.com to institutional investors. As its name suggests, Escrow.com provides online escrow services for e-commerce sites by holding payments for goods or&hellip; <a href=\"http://techcrunch.com/2015/04/26/freelancer-acquires-escrow/?ncid=rss\">Read More</a>',1430107648,'http://techcrunch.com/?p=1149487'),(70,1,'Alibaba Teams Up With China’s Largest Telecom To Sell Smartphones To Rural Customers','http://techcrunch.com/2015/04/26/alibaba-rural/?ncid=rss','Catherine Shu','<img width=\"680\" height=\"455\" src=\"https://tctechcrunch2011.files.wordpress.com/2014/11/alibaba-coffee-cup.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"alibaba coffee cup\" />&nbsp;Alibaba has partnered with China&#8217;s biggest telecom operator to sell low-cost smartphones to people in rural areas for prices as low as 299 RMB ($48). The deal with China Telecom, which has 186 million users, is part of a two-pronged strategy for the e-commerce giant, which sees smaller cities as key to its growth plans for its e-commerce business and operating system YunOS. A line of&hellip; <a href=\"http://techcrunch.com/2015/04/26/alibaba-rural/?ncid=rss\">Read More</a>',1430114187,'http://techcrunch.com/?p=1149496'),(71,1,'Engineering Director Lars Rasmussen Leaving Facebook To Co-Found A Music Startup','http://techcrunch.com/2015/04/27/rasmussen-facebook/?ncid=rss','Ingrid Lunden','<img width=\"680\" height=\"468\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/10443970_10153165831966264_4878229095593597655_n.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"10443970_10153165831966264_4878229095593597655_n\" />&nbsp;Facebook at Work, Facebook&#8217;s first move to turn its social network into an enterprise tool, has remained in closed beta since its launch in January this year. But as the product continues to inch its way to general availability, it will be doing so without one of its key architects. Lars Rasmussen &#8212; Facebook&#8217;s engineering director, who helped create and run Facebook&hellip; <a href=\"http://techcrunch.com/2015/04/27/rasmussen-facebook/?ncid=rss\">Read More</a>',1430128805,'http://techcrunch.com/?p=1149485'),(72,1,'Glia Raises Cash To Match Consumers And Companies Around Values','http://techcrunch.com/2015/04/27/glia-raises-cash-to-match-consumers-and-companies-around-values/?ncid=rss','Jonathan Shieber','<img width=\"680\" height=\"288\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/screen-shot-2015-04-26-at-6-55-19-pm.png?w=680\" class=\"attachment-large wp-post-image\" alt=\"Screen Shot 2015-04-26 at 6.55.19 PM\" />&nbsp;It&#8217;s with an eye toward that hypersensitive political climate that Barry Klein, a longtime political consultant has raised the first capital to grow Glia. Along with co-founders Chris Rappley, a longtime startup consultant, and Tahlia Sutton, a product development executive, Klein has developed Glia to be an app that blends Yelp and eHarmony, for what Klein calls &#8220;values-based&#8230; <a href=\"http://techcrunch.com/2015/04/27/glia-raises-cash-to-match-consumers-and-companies-around-values/?ncid=rss\">Read More</a>',1430130640,'http://techcrunch.com/?p=1149003'),(73,1,'Only Fifth Of U.S. Apple Watches Shipped Over Launch Weekend, Says Data Firm','http://techcrunch.com/2015/04/27/apple-watch-shipping-sliced/?ncid=rss','Natasha Lomas','<img width=\"680\" height=\"383\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/applewatchthumb4.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"applewatchthumb4\" />&nbsp;Apple&#8217;s debut wearable, the eponymous Apple Watch, started shipping Friday &#8212; but according to U.S. online commerce market research firm, Slice Intelligence, the launch weekend saw only around a fifth of U.S. buyers get a delivery from Cupertino. <a href=\"http://techcrunch.com/2015/04/27/apple-watch-shipping-sliced/?ncid=rss\">Read More</a>',1430135306,'http://techcrunch.com/?p=1149509'),(74,1,'Universal Avenue Gives Businesses On-Demand Access To A Direct Sales Team','http://techcrunch.com/2015/04/27/universal-avenue-gives-businesses-on-demand-access-to-a-direct-sales-team/?ncid=rss','Frederic Lardinois','<img width=\"680\" height=\"312\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/2015-04-26_1127.png?w=680\" class=\"attachment-large wp-post-image\" alt=\"2015-04-26_1127\" />&nbsp;B2B startups often rely on word-of-mouth and online advertising to get the word out about their products. Over time, they often add a marketing and sales department, but they typically don&#8217;t have the resources to build a full-blown salesforce for their products that can pitch business owners directly, especially when they are looking to expand internationally.\nUniversal Avenue, a&#8230; <a href=\"http://techcrunch.com/2015/04/27/universal-avenue-gives-businesses-on-demand-access-to-a-direct-sales-team/?ncid=rss\">Read More</a>',1430139604,'http://techcrunch.com/?p=1149418'),(75,1,'Discover Signs On With Apple Pay','http://techcrunch.com/2015/04/27/discover-signs-on-with-apple-pay/?ncid=rss','Darrell Etherington','<img width=\"680\" height=\"453\" src=\"https://tctechcrunch2011.files.wordpress.com/2014/09/img_4156.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"Apple Pay\" />&nbsp;Credit card provider Discover will join Apple Pay&#8217;s ranks beginning this fall, the company announced today. Apple Pay already supports cards from Visa, MasterCard and American Express, and with Discover, it will reach the overwhelming majority of cardholders in the U.S. Discover was the last noteworthy holdout from the service. Apple Pay with Discover will work the same way it does&hellip; <a href=\"http://techcrunch.com/2015/04/27/discover-signs-on-with-apple-pay/?ncid=rss\">Read More</a>',1430140374,'http://techcrunch.com/?p=1149514'),(76,1,'Consider Pitching A “Virtual Startup” To Your Boss','http://techcrunch.com/2015/04/27/consider-pitching-a-virtual-startup-to-your-boss/?ncid=rss','Steven Sokol','<img width=\"680\" height=\"559\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/umbrellas-e1429562590193.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"umbrellas\" />&nbsp;Over the years I&#8217;ve been part of several of startups, and I love the energy, excitement and sense of risk that comes with launching into uncharted waters. My last startup was acquired in 2007, and I&#8217;ve been working at the acquirer ever since. A bit over two years ago, I got the itch to do something entrepreneurial again. When I talked with my boss about quitting to build a new&hellip; <a href=\"http://techcrunch.com/2015/04/27/consider-pitching-a-virtual-startup-to-your-boss/?ncid=rss\">Read More</a>',1430143225,'http://techcrunch.com/?p=1145983'),(77,1,'Pinterest Adds Tools For Marketers To Post Better Pins','http://techcrunch.com/2015/04/27/pinterest-adds-tools-for-marketers-to-post-better-pins/?ncid=rss','Matthew Lynley','<img width=\"680\" height=\"453\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/01/pinterest-male-app.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"pinterest-male-app\" />&nbsp;Pinterest today said that it would launch what it&#8217;s calling its Marketer Developer Program, in which a set of partners will get access to new tools that allow them to better deliver more engaging content on Pinterest.\nThe tools consist of things like pin scheduling and optimization in the form of APIs for companies that post branded content across a variety of channels, and work with&#8230; <a href=\"http://techcrunch.com/2015/04/27/pinterest-adds-tools-for-marketers-to-post-better-pins/?ncid=rss\">Read More</a>',1430143245,'http://techcrunch.com/?p=1149493'),(78,1,'Google Launches A Marketplace To Buy Patents From Interested Sellers','http://techcrunch.com/2015/04/27/google-launches-a-marketplace-to-buy-patents-from-interested-sellers/?ncid=rss','Sarah Perez','<img width=\"680\" height=\"383\" src=\"https://tctechcrunch2011.files.wordpress.com/2014/06/patents-legal-ideas.jpg?w=680\" class=\"attachment-large wp-post-image\" alt=\"patents-legal-ideas\" />&nbsp;Google announced this morning the launch of an experimental program that will allow it to purchase patents from businesses and other patent holders who wish to sell. The company says its new &#8220;Patent Purchase Promotion,&#8221; opening next month, is an effort to &#8220;remove friction&#8221; from a patent market that currently fraught with patent trolls, lawsuits and other wasted&#8230; <a href=\"http://techcrunch.com/2015/04/27/google-launches-a-marketplace-to-buy-patents-from-interested-sellers/?ncid=rss\">Read More</a>',1430147383,'http://techcrunch.com/?p=1149573'),(79,1,'Android Surpasses iOS In Revenue, If China’s Android App Stores Are Combined','http://techcrunch.com/2015/04/27/android-surpasses-ios-in-revenue-if-chinas-android-app-stores-are-combined/?ncid=rss','Sarah Perez','<img width=\"640\" height=\"400\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/android-vs-ios-3d-battle.jpg?w=640\" class=\"attachment-large wp-post-image\" alt=\"Android vs iOS 3D battle\" />&nbsp;A new study out this morning upsets the traditional thinking that iOS applications make more money for mobile developers when compared with those that run on Android devices. Instead, after taking into account the large number of non-Google Play Chinese Android app stores in existence, advisory firm Digi-Capital found that not only did Android dominate download volumes in 2014, it also made&hellip; <a href=\"http://techcrunch.com/2015/04/27/android-surpasses-ios-in-revenue-if-chinas-android-app-stores-are-combined/?ncid=rss\">Read More</a>',1430147418,'http://techcrunch.com/?p=1149526'),(80,1,'Watch This X-Wing Make It To Space In Star Wars Premiere Ticket Bid','http://techcrunch.com/2015/04/27/watch-this-x-wing-make-it-to-space-in-star-wars-premiere-ticket-bid/?ncid=rss','Darrell Etherington','<img width=\"680\" height=\"360\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/screen-shot-2015-04-27-at-11-16-30-am.png?w=680\" class=\"attachment-large wp-post-image\" alt=\"Screen Shot 2015-04-27 at 11.16.30 AM\" />&nbsp;An X-Wing has made it to space in real life, thanks to a project by a two-person space photography outfit from Essex, UK launched as an attempt to get tickets to the Star Wars: The Force Awakens VIP premiere. Project Helium Tears, which uses weather balloons to take pictures of Earth from the very edge of space, fixed an X-Wing model to one of their balloons and sent it up, capturing the flight&hellip; <a href=\"http://techcrunch.com/2015/04/27/watch-this-x-wing-make-it-to-space-in-star-wars-premiere-ticket-bid/?ncid=rss\">Read More</a>',1430147909,'http://techcrunch.com/?p=1149596'),(81,1,'BuzzFeed Pitches Advertisers On “Pound” Tech That Tracks A Story’s Viral Spread','http://techcrunch.com/2015/04/27/buzzfeed-newfronts/?ncid=rss','Anthony Ha','<img width=\"625\" height=\"347\" src=\"https://tctechcrunch2011.files.wordpress.com/2015/04/unnamed2.png?w=625\" class=\"attachment-large wp-post-image\" alt=\"BuzzFeed Pound\" />&nbsp;BuzzFeed is known as the king of viral content, and today it&#8217;s sharing more details about a new technology showing how that content actually spreads.\nBy using what it calls Pound (short for Process for Optimizing and Understanding Network Diffusion), BuzzFeed promises to go beyond just counting social media shares and clicks. In a blog post, BuzzFeed Publisher Dao Nguyen writes: <a href=\"http://techcrunch.com/2015/04/27/buzzfeed-newfronts/?ncid=rss\">Read More</a>',1430152471,'http://techcrunch.com/?p=1149592');
